import React from "react";

const Movies = (props) => {
  const { data } = props;

  return (
    <div>
      {console.log("movie.jsx data " + data)}
      {data.map((m) => {
        return (
          <li key={m.id}>
            <h6>{m.title}</h6>
            <p>Rating: {m.vote_average}</p>
          </li>
        );
      })}
    </div>
  );
};

export default Movies;
